import React from 'react';
import Tweet from './Tweet';


class TweetBoard extends React.Component {

    render(){
        // return list of tweets
        return this.props.tweets.map((message) => (
            <Tweet
                key={message.id}
                tweet={message}
            />
        ))
    }
}

export default TweetBoard;
